import {Navigate} from 'react-router-dom';
import React from 'react';

function Menu() {
  const [goToLogin,setGoToLogin] = React.state('false');
  
  if(goToLogin){
    return <Navigate to = "/src/pages/Login.js"/>
  }
  return (
    <div>
      <h1 style  = {MenuStyle}>Menu</h1 >
      <button style={{float: 'right'}} onClick = {() => {setGoToLogin(true)}}>Log in</button>
      <Food item_id = {123} name = "Meat" price = {2.00} calories = {200} type_id = {222}/>
      <button>Order </button>
    </div>
  );

};

const MenuStyle = {
  color: 'blue',
  textAlign : "left"
};

const FoodStyle = {
  color: 'black',
  textAlign : "left"
};

const Food = (props) => {
  return ( 
    <div style  = {FoodStyle}>
      <h2 >{props.name}</h2>
      <p >{props.price}</p>
      <p >{props.calories}</p>
      <p >{props.type_id}</p>
      <p >{props.item_id}</p>
    </div>
  );
};

export default Menu;
